import React from 'react';
import { AppBar, Toolbar, Typography, ListItem, IconButton, ListItemText, Avatar, Divider, List, Container, Box, ListItemIcon} from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import { ArrowBack, AssignmentInd, Home, Apps, ContactMail} from '@material-ui/icons';
import avatar from "./avatar/avatar-robbie.png";


// import classes from '*.module.css';
// CSS STYLES
const useStyles = makeStyles((theme)=> ({
    hiddenMenuContainer: {
        width: 250,
        background: '#c0392b',
        height: "30rem"
    },
    avatar: {
        display: 'block',
        margin: '0.5rem auto',
        width: theme.spacing(13),
        height: theme.spacing(13)
    }


}))
//Main Content for Navbar
const Navbar = () => {
    const classes = useStyles();
    return (
        <>
        <Box className = {classes.hiddenMenuContainer} component="div">
            <Avatar className={classes.avatar} src={avatar} alt="Alton Ong"></Avatar>
            <Divider/>
            <List>
                <ListItem>
                    <ListItemIcon>

                    </ListItemIcon>
                </ListItem>
            </List>
        </Box>
        <Box component="nav">
            <AppBar position="static" style={{background: "#34495e"}}>
                <Toolbar>
                    <IconButton>
                        <ArrowBack style={{color: '#f1c40f'}}/>
                    </IconButton>
                    <Typography variant="h5" style={{color: '#ecf0f1'}}>
                        PrepMe
                    </Typography>
                </Toolbar>
            </AppBar>
        </Box>
        </>
    )
};

export default Navbar;
